            -moz-border-radius: 200px;
            border-radius: 200px;

            width: 180px;
            height: 180px;
            right: 50px;
            top: -90px;
        }
        .activenight {
            transform: rotate(0deg);
            transition: transform 330ms ease-in-out;
        }

        .deactivenight {
            transform: rotate(180deg);
            transition: transform 330ms ease-in-out;
        }

        .activeday {
            transform: rotate(0deg);
            transition: transform 330ms ease-in-out;
        }

        .deactiveday {
            transform: rotate(180deg);
            transition: transform 330ms ease-in-out;
        }

        .deactivate {
            display: none;
        }
        .background-container {
  position: absolute;
  top: 0;
  left: 0;
  width: 100vw; /* Utilisez 100% de la largeur de la vue */
  height: 100vh; /* Utilisez 100% de la hauteur de la vue */

  overflow: hidden; /* Masque tout contenu qui dépasse de la taille du conteneur */
}
</style>
<script>
export default {
  data() {
    return {
      hour: "day",
    };
  },
  mounted() {
    const toggleButton = document.getElementById("toggleButton");
    const nightToAnimate = document.getElementById("night"); // Remplacez "night" par l'ID correct
    const dayToAnimate = document.getElementById("day"); // Remplacez "day" par l'ID correct
    const nightbackgroundToAnimate = document.getElementById("backgroundnight"); // Remplacez "backgroundnight" par l'ID correct

    toggleButton.addEventListener("click", () => {
      if (this.hour === "day") {
        dayToAnimate.classList.add("deactiveday");
        dayToAnimate.classList.remove("activeday");
        nightToAnimate.classList.add("activenight");
        nightToAnimate.classList.remove("deactivenight");
        nightbackgroundToAnimate.classList.remove("deactivate");
        this.hour = "night";
      } else {
        dayToAnimate.classList.add("activeday");
        dayToAnimate.classList.remove("deactiveday");
        nightToAnimate.classList.add("deactivenight");
        nightToAnimate.classList.remove("activenight");
        nightbackgroundToAnimate.classList.add("deactivate");
        this.hour = "day";
      }
    });
  },
};
</script>